description:
Hello cats and kittens! It's time for me to once again drag you scricking and keaming into the wonderful reprint cesspool that is the Eerie Publications universe.

Beholdify! This torrent contains an additional 66 issues of digital dookie! Most of these are *new*, though I think there are 2-3 issues which are replacements for previously-uploaded incomplete or damaged scans.

Where do I keep finding these goddamned things, you ask, quite possibly with hot tears of anger spilling down your face??? Well, in this case, they found me. Rainer, the webmaster/showrunner of an Eerie Pubs website, happened across my earlier torrents and reached out to me with an invite to visit his site. Every one of these new issues came from his site, many of which are being scanned in-house and for the first time! Please feel free to visit he and his, give him a &quot;THANK YOU!/DEAR GOD, WHY ARE YOU SCANNING THESE?&quot; shout-out and keep checking back as he and his team continue their effort to locate and digitize the remaining eleven or so missing Eerie Pubs magazines. Go ye here:
